import './App.scss';
import Navbar from './components/Navbar/Navbar';
import AuthPage from './pages/AuthPage/AuthPage';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="app">
      <Router>
     <Navbar />

      <Routes></Routes>

     </Router>
     <AuthPage />
    </div>
  );
}

export default App;
